pragma solidity >=0.6.0;
// SPDX-License-Identifier: UNLICENSED
pragma experimental ABIEncoderV2;
import './Uniswap.sol';
import './Optimizers.sol';
import './Balancer.sol';

// ["balancer","uniswap","0xC5570FC7C828A8400605e9843106aBD675006093","0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f"],"0x4F96Fe3b7A6Cf9725f59d353F723c1bDb64CA6Aa","0xd0A1E359811322d97991E03f863a0C30C2cF029C","0xd0A1E359811322d97991E03f863a0C30C2cF029C","10000000"

contract optimalOpportunities {
	address UniswapFactoryAddress; //For converting to std
	address owner;

	// OouterCoin -> innerCoin -> outerCoin
	struct Exchanges {
		string exchangeIn;
		string exchangeOut;
		address inProxy;
		address outProxy;
	}

	struct Opportunity {
		address outerCoin;
		address innerCoin;
		string awayExchange;
		address awayPool;
		string returnExchange;
		address returnPool;
		uint256 inputWeiCoin;
		uint256 innerWeiCoin;
		uint256 outputWeiCoin;
		uint256 diff;
		uint256 stdDiff;
		bool ignore;
	}

	struct OptimalInfo {
		address tokenIn;
		address tokenOut;
		uint256 reserveIn;
		uint256 reserveOut;
		int128 optimalPreMP;
		int128 MP;
		uint256 optimalInput;
		uint256 optimalOutput;
		address poolAddress;
		uint256 portion;
		string exchange;
		address proxy;
		uint256 weightIn; // balancer weights if on balancer
		uint256 weightOut;
		int128 swapFee; // swap fee on balancer
		bool ignore;
	}

	//Create modifier to limit who can call the contract
	modifier onlyOwner() {
		require(msg.sender == owner, 'Sender not authorized.');
		// Do not forget the "_;"! It will
		// be replaced by the actual function
		// body when the modifier is used.
		_;
	}

	constructor(address uniswapFactory) {
		UniswapFactoryAddress = uniswapFactory;
		owner = msg.sender;
	}

	//Change the contract owner
	function changeOwner(address payable newOwner) external onlyOwner {
		owner = newOwner;
	}

	//Change the router address
	function changeUniswapFactory(address newAddress) external onlyOwner {
		UniswapFactoryAddress = newAddress;
	}

	function getBestOpportunity(
		address outerToken,
		address innerToken,
		address stdCoin,
		uint256 portion,
		bytes calldata _exchanges
	) external view returns (Opportunity memory) {
		//Decode object and get both direction exchanges
		Exchanges memory exchanges = abi.decode(_exchanges, (Exchanges));
		Exchanges memory exchangesReversed = Exchanges(exchanges.exchangeOut, exchanges.exchangeIn, exchanges.outProxy, exchanges.inProxy);

		//Get opportunities for both directions and compare them
		Opportunity memory currentOpp = getOpportunity(exchanges, outerToken, innerToken, stdCoin, portion);
		Opportunity memory oppositeOpp = getOpportunity(exchanges, outerToken, innerToken, stdCoin, portion);
		if (currentOpp.ignore) {
			return oppositeOpp;
		} else if (oppositeOpp.ignore) {
			return currentOpp;
		} else {
			return currentOpp.stdDiff > oppositeOpp.stdDiff ? currentOpp : oppositeOpp;
		}
	}

	function getOpportunity(
		Exchanges memory _exchanges,
		address outerToken,
		address innerToken,
		address stdCoin,
		uint256 portion
	) internal view returns (Opportunity memory) {
		OptimalInfo memory awayInfo = OptimalInfo(outerToken, innerToken, 0, 0, 0, 0, 0, 0, address(0), portion, _exchanges.exchangeIn, _exchanges.inProxy, 0, 0, 0, false);
		OptimalInfo memory returnInfo = OptimalInfo(innerToken, outerToken, 0, 0, 0, 0, 0, 0, address(0), portion, _exchanges.exchangeOut, _exchanges.outProxy, 0, 0, 0, false);
		awayInfo = getAlmostAllOptimalInfo(awayInfo);
		returnInfo = getAlmostAllOptimalInfo(returnInfo);
		bool ignore = false;
		if (!awayInfo.ignore && !returnInfo.ignore) {
			// 	Multiplying optimal away output by return mp, multiplying optimal return output by away mp
			awayInfo = getInputOutputByExchange(awayInfo, returnInfo);
			returnInfo = getInputOutputByExchange(returnInfo, awayInfo);
			if (!awayInfo.ignore && !returnInfo.ignore) {
				if (awayInfo.optimalOutput <= returnInfo.optimalInput) {
					// recalc return using away's output as input
					returnInfo.optimalOutput = getOutputFromInputByExchange(awayInfo.optimalOutput, returnInfo);
				} else {
					// recalc away using return's input as output
					awayInfo.optimalInput = getInputFromOutputByExchange(returnInfo.optimalInput, awayInfo);
					awayInfo.optimalOutput = returnInfo.optimalInput;
				}
			} else {
				ignore = true;
			}
		} else {
			ignore = true;
		}
		Opportunity memory unstandardizedOpp = Opportunity(awayInfo.tokenIn, awayInfo.tokenOut, awayInfo.exchange, awayInfo.poolAddress, returnInfo.exchange, returnInfo.poolAddress, awayInfo.optimalInput, awayInfo.optimalOutput, returnInfo.optimalOutput, returnInfo.optimalOutput > awayInfo.optimalInput ? returnInfo.optimalOutput - awayInfo.optimalInput : 0, 0, ignore);
		return standardize(unstandardizedOpp, stdCoin);
	}

	function standardize(Opportunity memory unstandardizedOpp, address stdCoin) internal view returns (Opportunity memory standardizedOpp) {
		if (unstandardizedOpp.outerCoin != stdCoin) {
			try Uniswap.getReserves(unstandardizedOpp.outerCoin, stdCoin, UniswapFactoryAddress) returns (uint256 reserveIn, uint256 reserveOut, address poolAddress) {
				try Uniswap.getAmountOut(unstandardizedOpp.diff, reserveIn, reserveOut) returns (uint256 output) {
					unstandardizedOpp.stdDiff = output;
				} catch {}
			} catch {}
		} else {
			unstandardizedOpp.stdDiff = unstandardizedOpp.diff;
		}
		return unstandardizedOpp;
	}

	function getAlmostAllOptimalInfo(OptimalInfo memory info) internal view returns (OptimalInfo memory optimalInfo) {
		if (keccak256(bytes(info.exchange)) == keccak256(bytes('uniswap'))) {
			try Uniswap.getReserves(info.tokenIn, info.tokenOut, info.proxy) returns (uint256 reserveIn, uint256 reserveOut, address poolAddress) {
				(info.reserveIn, info.reserveOut, info.poolAddress) = (reserveIn, reserveOut, poolAddress);
				info.swapFee = 18022469000000000000;
				info.optimalPreMP = Optimizers.getUniOptimalPreMP(info);
				info = getMPByExchange(info);
			} catch {
				info.ignore = true;
			}
		} else if (keccak256(bytes(info.exchange)) == keccak256(bytes('balancer'))) {
			try Balancer.getPoolInfo(info.tokenIn, info.tokenOut, info.proxy) returns (address poolAddress, uint256 tokenBalanceIn, uint256 tokenBalanceOut, uint256 tokenWeightIn, uint256 tokenWeightOut, uint256 swapFee) {
				(info.reserveIn, info.reserveOut, info.poolAddress, info.weightIn) = (tokenBalanceIn, tokenBalanceOut, poolAddress, tokenWeightIn);
				info.weightOut = tokenWeightOut;
				info.swapFee = Optimizers.bNumToAbdk(swapFee);
				try Optimizers.getBalOptimalPreMP(info) returns (OptimalInfo memory newInfo) {
					info = getMPByExchange(newInfo);
				} catch {
					info.ignore = true;
				}
			} catch {
				info.ignore = true;
			}
		}
		return info;
	}

	function getMPByExchange(OptimalInfo memory params) internal pure returns (OptimalInfo memory optimalInfo) {
		if (keccak256(bytes(params.exchange)) == keccak256(bytes('uniswap'))) {
			try Uniswap.getMP(params.reserveOut, params.reserveIn) returns (int128 MP) {
				params.MP = MP;
			} catch {
				params.ignore = true;
			}
		} else if (keccak256(bytes(params.exchange)) == keccak256(bytes('balancer'))) {
			try Optimizers.calcSpotPrice(params.reserveOut, params.weightOut, params.reserveIn, params.weightIn, params.swapFee) returns (int128 MP) {
				params.MP = MP;
			} catch {
				params.ignore = true;
			}
		}
		return params;
	}

	function getInputOutputByExchange(OptimalInfo memory info, OptimalInfo memory oppositeInfo) internal view returns (OptimalInfo memory optimalInfo) {
		if (keccak256(bytes(info.exchange)) == keccak256(bytes('uniswap'))) {
			info.optimalOutput = Optimizers.getUniOptimalGivenMp(info.optimalPreMP, oppositeInfo.MP, info.portion, info.reserveOut);
			if (info.optimalOutput > 0) {
				try Uniswap.getAmountIn(info.optimalOutput, info.reserveIn, info.reserveOut) returns (uint256 optimalInput) {
					info.optimalInput = optimalInput;
				} catch {
					info.ignore = true;
				}
			} else {
				info.ignore = true;
			}
		} else if (keccak256(bytes(info.exchange)) == keccak256(bytes('balancer'))) {
			info.optimalInput = Optimizers.getBalOptimalGivenMp(info, oppositeInfo);
			if (info.optimalInput > 0) {
				try Balancer.getAmountOut(info.poolAddress, info.tokenIn, info.tokenOut, info.optimalInput) returns (uint256 optimalOutput) {
					info.optimalOutput = optimalOutput;
				} catch {
					info.ignore = true;
				}
			} else {
				info.ignore = true;
			}
		}
		return info;
	}

	function getInputFromOutputByExchange(uint256 output, OptimalInfo memory awayInfo) internal view returns (uint256 input) {
		if (output > 0) {
			if (keccak256(bytes(awayInfo.exchange)) == keccak256(bytes('uniswap'))) {
				try Uniswap.getAmountIn(output, awayInfo.reserveIn, awayInfo.reserveOut) returns (uint256 input) {
					return input;
				} catch {}
			} else if (keccak256(bytes(awayInfo.exchange)) == keccak256(bytes('balancer'))) {
				try Balancer.getAmountIn(awayInfo.poolAddress, awayInfo.tokenIn, awayInfo.tokenOut, output) returns (uint256 input) {
					return input;
				} catch {}
			}
		}
		return 0;
	}

	function getOutputFromInputByExchange(uint256 input, OptimalInfo memory returnInfo) internal view returns (uint256 output) {
		if (input > 0) {
			if (keccak256(bytes(returnInfo.exchange)) == keccak256(bytes('uniswap'))) {
				try Uniswap.getAmountOut(input, returnInfo.reserveIn, returnInfo.reserveOut) returns (uint256 output) {
					return output;
				} catch {}
			} else if (keccak256(bytes(returnInfo.exchange)) == keccak256(bytes('balancer'))) {
				try Balancer.getAmountOut(returnInfo.poolAddress, returnInfo.tokenIn, returnInfo.tokenOut, input) returns (uint256 output) {
					return output;
				} catch {}
			}
		}
		return 0;
	}
}
